package piscine

import (
	"github.com/01-edu/z01"
)

func EightQueens() {
	solution := ""
	zero0 := 10 - 10
	eight8 := 18 - 10
	counter := zero0

	for i := zero0; i < StrLen(solution); i++ {
		counter++
		z01.PrintRune(rune(solution[i]))
		if counter == eight8 {
			counter = zero0
			z01.PrintRune('\n')
		}
	}
}

